import React from "react";
import { Image, VStack, Text, Box, Pressable, IPressableProps, HStack, ScrollView, Center } from "native-base";

type Props = {
  name?: string;
};

export function ArtistsFeed ({ name, ...rest }: Props)  {
  const artistData = [
    { name: "Imagine Dragons", image: require('@assets/imaginedragons.jpg') },
    { name: "Alok", image: require('@assets/alok2.jpeg') },
    { name: "Hozier", image: require('@assets/hozier2.jpeg') },
    { name: "The Lumineers", image: require('@assets/thelumineers2.jpeg') },
    { name: "Calvin Harris", image: require('@assets/calvinharris.jpeg') },
  ];

  return (
    <ScrollView horizontal showsHorizontalScrollIndicator={false} >
      <HStack>
        {artistData.map((artist, index) => (
          <Pressable
            key={index}
            margin={2}
            width={20}
            alignItems='center'
            onPress={() => {

            }}
            overflow="hidden"
            marginTop={14}
            {...rest}
          >
            <Box mb={2}>
              <Image
                source={artist.image}
                style={{
                  height: 63,
                  width: 63,
                  borderRadius: 1000,
                  overflow: "hidden",
                }}
                resizeMode="cover"
                alt={`Image for ${artist.name}`}
              />
              <Center>
                <Text
                  color="gray.200"
                  fontSize="xs"
                  fontWeight="bold"
                  textAlign="center"
                  marginTop={1}
                >
                  {artist.name}
                </Text>
              </Center>
            </Box>
          </Pressable>
        ))}
      </HStack>
    </ScrollView>
  );
};
